import React,{useState} from 'react';
import image from '../resources/logo.png';


const Navbar = () => {
    const cssStyle = {};
    if(theme === 'false'){
        cssStyle.color = "red";
    }else{
        cssStyle.color = "black";

    }
   const [theme, setState] = useState("false");
    const themed=()=>{
        if(theme === 'false'){
            cssStyle.color = "red";
            setState('true')
        }else{
            cssStyle.color = "black";
            setState('false')
        }

    
}
    
    return (
        <div>
        <div className='bodypart'>
            <div className="Navbar">
                <div className='Logo'>
                    <img src={image} alt='logo'/>
                </div>
                <div className='Serchbox'>
                <h1>+</h1>
                    <input type="text" placeholder='Serch for intrest'/>
                </div>
                <div className='theme'>
                    <input type = "checkbox" onChange={themed}/>
                </div>
                <h2 style={cssStyle}>atif</h2>
                <div className='links' >
                    <a href='#aboutme'>About Me </a>
                    <a href="#project">Project </a>
                    <a href="/">Info </a>
                    <a href="/">Feedback </a>
                    <a href="/">Contact </a>
                </div>
            </div>
            </div>
        </div>
    );
}

export default Navbar;
